'use strict';

var Yada = function () {
  this.canvas = document.getElementById('ithinkimgoingtoplaywithcanvastoday');
  this.ctx = canvas.getContext('2d');
  this.image = new Image();
  this.start = window.mozAnimationStartTime || new Date().getTime();
  this.fps = 35;
  this.imageWidth = 450;
  this.imageHeight = 450;
};

Yada.prototype.yada = function () {
  var self = this;

  this.image.src = 'data:image/png;base64,';
  this.image.width = this.imageWidth;
  this.image.height = this.imageHeight;
  this.image.onload = function () {
    self.ctx.drawImage(self.image, 0, 0);

    self.imageData = self.ctx.getImageData(0, 0, self.imageWidth, self.imageHeight);
    self.imageDataNew = self.ctx.getImageData(0, 0, self.imageWidth, self.imageHeight);
    self.pixels = self.imageData.data;
    self.pixelsNew = self.imageDataNew.data;
    self.generate(self.start);
  };
};

Yada.prototype.generate = function (timestamp) {
  var pSwitch = Math.floor(Math.random() * 2);
  var progress = timestamp - this.start;
  var switchFlag = Math.round(Math.random() * 1);
  var self = this;

  var imageArea = this.imageWidth * this.imageHeight * 4;

  for (var i = 0; i < imageArea; i ++) {
    if (Math.floor(Math.random() * 255) < 5) {
      if (switchFlag) {
        this.pixelsNew[i] = Math.floor(Math.random() * 105 + Math.floor(Math.random() * 100));
        this.pixelsNew[i++] = Math.floor(Math.random() * 105 + Math.floor(Math.random() * 10));
      }
      this.pixelsNew[i++] = Math.floor(Math.random() * 125 + Math.floor(Math.random() * 50));
    } else {
      this.pixelsNew[i++] = Math.floor(Math.random() * 205 + Math.floor(Math.random() * 50));
      this.pixelsNew[i++] = Math.floor(Math.random() * 115);
      if (switchFlag) {
        this.pixelsNew[i++] = Math.floor(Math.random() * 15 - Math.floor(Math.random() * 200));
        this.pixelsNew[i++] = Math.floor(Math.random() * 55) + Math.floor(Math.random() * 100);
      }
    }

    this.pixelsNew[i++] = Math.floor(Math.random() * 115);
    if (switchFlag) {
      this.pixelsNew[i] = Math.floor(Math.random() * 45);
      this.pixelsNew[i++] = Math.floor(Math.random() * 15);
      this.pixelsNew[i++] = Math.floor(Math.random() * 10) + Math.floor(Math.random() * 100);
    } else {
      this.pixelsNew[i] = Math.floor(Math.random() * 205) + Math.floor(Math.random() * 50);
    }
  }

  this.ctx.putImageData(this.imageDataNew, 0, 0);

  setTimeout(function() {
    requestAnimationFrame(self.generate.bind(self));
  }, 1000 / self.fps);
};
